import YenaHeader from "../components/YenaHeader";
import styled from "styled-components";
/**  ---------------필터 부분 ----------------  */
const Filter = styled.div`
  width: 100%;
  height: 100px;
  background-color: #f0f1f3;
`;

/**  ---------------메인 부분 ----------------  */
const MainContainer = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
  width: 100%;
`;
const Favorite = styled.div`
  width: 25%;
  border-right: 2px solid #d7d9db;
  height: 100%;
  margin: 0px 40px 0px 30px;
  div {
    background-color: grey;
    width: 300px;
    height: 150px;
    margin-top: 30px;
  }
`;
const ArtWorksContainer = styled.div`
  width: 75%;
  display: grid;
  grid-template-columns: repeat(3, 1fr);
`;
const Product = styled.div`
  margin-top: 30px;
  .artpiece {
    background-color: grey;
    width: 300px;
    height: 350px;
  }
  .artist {
    display: flex;
    align-items: center;
    margin-top: 10px;
    h2 {
      font-weight: 800;
      margin-right: 10px;
    }
    div {
      background-color: black;
      color: white;
      width: 60px;
      height: 20px;
      border-radius: 40%;
      text-align: center;
    }
  }
`;

function Yena() {
  return (
    <>
      <YenaHeader />
      <Filter></Filter>
      <MainContainer>
        <Favorite>
          favorite
