              <h2>작가</h2>
              <div>팔로우</div>
            </div>
            <span>작품이름</span>
            <p>가격</p>
          </Product>
          <Product>
            <div className="artpiece"></div>
            <div className="artist">
              <h2>작가</h2>
              <div>팔로우</div>
            </div>
            <span>작품이름</span>
            <p>가격</p>
          </Product>
          <Product>
            <div className="artpiece"></div>
            <div className="artist">
              <h2>작가</h2>
              <div>팔로우</div>
            </div>
            <span>작품이름</span>
            <p>가격</p>
          </Product>
          <Product>
            <div className="artpiece"></div>
            <div className="artist">
              <h2>작가</h2>
              <div>팔로우</div>
            </div>
            <span>작품이름</span>
            <p>가격</p>
          </Product>
          <Product>
            <div className="artpiece"></div>
            <div className="artist">
              <h2>작가</h2>
              <div>팔로우</div>
            </div>
            <span>작품이름</span>
            <p>가격</p>
          </Product>
          <Product>
            <div className="artpiece"></div>
            <div className="artist">
              <h2>작가</h2>
              <div>팔로우</div>
            </div>
            <span>작품이름</span>
            <p>가격</p>
          </Product>
        </ArtWorksContainer>
      </MainContainer>
    </>
  );
}

export default Yena;
